//Write a function variableNameify(words) that takes in an array of words. The function should return a string representing the //variable name obtained by combining the words and captitalizing them in mixCased style.

function variableNameify(words){
    let newWordArray  = [];
    newWordArray.push(words[0].toLowerCase())
    
    for(let i = 1; i < words.length; i++){
        let currentWord = words[i];
        currentWord = currentWord.toLowerCase();

        let firstLetter = currentWord.charAt(0);
        let firstLetterCap = firstLetter.toUpperCase();

        let remainingLetters = currentWord.slice(1);
        let capitalizedWord = firstLetterCap + remainingLetters;

        newWordArray.push(capitalizedWord);
    }

    newWordArray = newWordArray.join("");
    return newWordArray;
}

console.log(variableNameify(['is', 'prime'])) // => 'isPrime'
console.log(variableNameify(['remove', 'last', 'vowel'])) // => 'removeLastVowel'

function getLastname() {
  var nameField = document.querySelector('input#fullname');  //substituir o seletor nessa linha
  var name = nameField.value;
 
  // Dividindo o nome em partes usando o espaço em branco para separar
  var names = name.split(' ');
 
  // Verificando se há mais de um nome
  if (names.length > 1) {
    // Retorne o último nome
    return names[names.length - 1];
  } else {
    // Se houver apenas um nome, retorne uma string vazia
    return '';
  }
}

function getName() {
  var nameField = document.querySelector('input#fullname');  //colocar seu seletor nessa linha
  var name = nameField.value;
 
  // Dividindo o nome em partes usando o espaço em branco para separar
  var names = name.split(' ');
 
  // Verificando se há mais de um nome
  if (names.length > 1) {
    // Removendo o último nome
    names.pop();
  }
 
  // Juntando os nomes novamente em uma única string
  var result = names.join(' ');
 
  return result;
}

using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class Managers : MonoBehaviour
{
    [SerializeField] GameObject sonicPrefab;
    [SerializeField] Transform spawnPoint;
    [SerializeField] Transform targetMaxDistance;
    [SerializeField] float speed = 5.0f;
    [SerializeField] float spawnDelay = 0.5f;

    private GameObject sonicInstance;
    private Rigidbody2D sonicRB;
    private Vector3 targetPosition;
    
    private bool attemptInProgress;

    private void Start()
    {
        // spawn sonic clone
        Debug.Log("Creating first sonic");
        sonicInstance = Instantiate(sonicPrefab, spawnPoint.position, spawnPoint.rotation);
        // freeze constraints
        sonicRB = sonicInstance.GetComponent<Rigidbody2D>();
        sonicRB.constraints = RigidbodyConstraints2D.FreezeAll;
        attemptInProgress = false;
        targetPosition = targetMaxDistance.position;
    }

    private void FixedUpdate()
    {
        if (Input.GetKey(KeyCode.Mouse0) && !attemptInProgress)
        {
            Debug.Log("Starting attempt");
            attemptInProgress = true;
            sonicRB.constraints = RigidbodyConstraints2D.None;
        }

        if (!attemptInProgress)
        {
            var step = speed * Time.deltaTime;
            sonicInstance.transform.position = Vector3.MoveTowards(sonicInstance.transform.position, targetPosition, step);

            if (Vector3.Distance(sonicInstance.transform.position, targetPosition) < 0.001f)
            {
                // flip position to neg
                targetPosition.x *= -1.0f;
            }
        }
    }

    private IEnumerator SpawnSonic()
    {
        yield return new WaitForSeconds(spawnDelay);
        Debug.Log("Creating new sonic");
        sonicInstance = Instantiate(sonicPrefab, spawnPoint.position, spawnPoint.rotation);
        sonicRB = sonicInstance.GetComponent<Rigidbody2D>();
        sonicRB.constraints = RigidbodyConstraints2D.FreezeAll;
        attemptInProgress = false;
        targetPosition.x *= -1.0f;
    }

    public void ResetSonic()
    {
        Debug.Log("Killing sonic");
        Destroy(sonicInstance);
        StartCoroutine(SpawnSonic());
    }
}
